import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Parse from 'parse';

const Admin = () => {
  const [isAdmin, setIsAdmin] = useState(false);
  const [adminPass, setAdminPass] = useState('');
  const [courseId, setCourseId] = useState('linux');
  const [formData, setFormData] = useState({ instructor: '', videoLink: '' });

  // Tabs: 'pending' | 'approved' | 'users'
  const [activeTab, setActiveTab] = useState('pending');
  const [dataList, setDataList] = useState([]);
  const [loading, setLoading] = useState(false);

  const checkPass = () => {
    if (adminPass === "snx_admin_2026") setIsAdmin(true);
    else alert("Wrong Password! ❌");
  };

  // Data Fetching Logic (Enrollments သို့မဟုတ် Users)
  const fetchData = async () => {
    setLoading(true);
    try {
      let query;
      if (activeTab === 'users') {
        query = new Parse.Query(Parse.User); // Registered Users တွေကို ဆွဲထုတ်မယ်
      } else {
        query = new Parse.Query("Enrollments"); // Enrollments (Pending/Approved) ကို ဆွဲထုတ်မယ်
        query.equalTo("status", activeTab);
      }
      query.descending("createdAt");
      const results = await query.find();
      setDataList(results);
    } catch (error) {
      console.error("Fetch Error:", error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (isAdmin) {
      fetchData();

      // Live Query for Real-time
      let subscription;
      const setupLiveQuery = async () => {
        const query = new Parse.Query("Enrollments");
        subscription = await query.subscribe();
        subscription.on('create', fetchData);
        subscription.on('update', fetchData);
      };
      setupLiveQuery();
      return () => { if(subscription) subscription.unsubscribe(); };
    }
  }, [isAdmin, activeTab]);

  const handleApprove = async (objectId) => {
    try {
      const query = new Parse.Query("Enrollments");
      const enrollment = await query.get(objectId);
      enrollment.set("status", "approved");
      await enrollment.save();
      alert("AGENT ACTIVATED! ✅");
      fetchData();
    } catch (err) { alert(err.message); }
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    const Course = Parse.Object.extend("Classes");
    const query = new Parse.Query(Course);
    query.equalTo("courseId", courseId);
    try {
      let obj = await query.first();
      if (!obj) { alert("Class not found!"); return; }
      obj.set("instructor", formData.instructor);
      obj.set("videoLink", formData.videoLink);
      await obj.save();
      alert("Mission Data Updated! ✅");
    } catch (err) { alert(err.message); }
  };

  if (!isAdmin) return (
    <div style={styles.loginOverlay}>
      <h2 style={{color: '#00ff41'}}>[ ADMIN SYSTEM LOGIN ]</h2>
      <input type="password" placeholder="PASSWORD" onChange={e => setAdminPass(e.target.value)} style={styles.loginInput} />
      <button onClick={checkPass} style={styles.loginBtn}>ENTER COMMAND</button>
    </div>
  );

  return (
    <div style={styles.adminBody}>
      <div style={styles.header}>
        <h1>COMMAND CENTER</h1>
        <Link to="/add-class" style={styles.addClassBtn}>+ ADD CLASS</Link>
      </div>

      <div style={styles.gridContainer}>
        {/* Update Form */}
        <section style={styles.section}>
          <h3 style={{color: '#86efac'}}>SET_CLASS_INFO</h3>
          <form onSubmit={handleUpdate} style={styles.form}>
            <select onChange={e => setCourseId(e.target.value)} style={styles.input}>
              <option value="linux">Linux Admin</option>
              <option value="cyber">Cyber Security</option>
              <option value="hacking">World Hacking</option>
              <option value="py_basic">Python Basic</option>
            </select>
            <input placeholder="Instructor" onChange={e => setFormData({...formData, instructor: e.target.value})} style={styles.input} />
            <input placeholder="Video Link ID" onChange={e => setFormData({...formData, videoLink: e.target.value})} style={styles.input} />
            <button type="submit" style={styles.updateBtn}>UPDATE</button>
          </form>
        </section>

        {/* Student Management */}
        <section style={styles.section}>
          <div style={styles.tabHeader}>
            <button onClick={() => setActiveTab('pending')} style={activeTab === 'pending' ? styles.activeTab : styles.tab}>PENDING</button>
            <button onClick={() => setActiveTab('approved')} style={activeTab === 'approved' ? styles.activeTab : styles.tab}>APPROVED</button>
            <button onClick={() => setActiveTab('users')} style={activeTab === 'users' ? styles.activeTab : styles.tab}>USERS</button>
          </div>

          <div style={styles.listContainer}>
            {loading ? <p>LOADING...</p> : dataList.map((item) => (
              <div key={item.id} style={styles.card}>
                <div>
                  <div style={{color: '#00ff41'}}>{item.get('studentName') || item.get('username')}</div>
                  <div style={{fontSize: '12px', color: '#8892b0'}}>
                    {activeTab === 'users' ? `Email: ${item.get('email')}` : `Phone: ${item.get('phoneNumber')}`}
                  </div>
                  <div style={{fontSize: '11px', color: '#555'}}>
                    {item.get('courseTitle') || "Just Registered"} | {item.createdAt.toLocaleDateString()}
                  </div>
                </div>
                {activeTab === 'pending' && <button onClick={() => handleApprove(item.id)} style={styles.approveBtn}>APPROVE</button>}
              </div>
            ))}
          </div>
        </section>
      </div>
    </div>
  );
};

const styles = {
  loginOverlay: { background: '#0a192f', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column', fontFamily: 'monospace' },
  loginInput: { margin: '15px', padding: '10px', background: '#112240', border: '1px solid #00ff41', color: '#00ff41', textAlign: 'center' },
  loginBtn: { background: '#00ff41', padding: '10px 20px', border: 'none', cursor: 'pointer', fontWeight: 'bold' },
  adminBody: { background: '#0a192f', minHeight: '100vh', color: '#00ff41', padding: '40px 5%', fontFamily: 'monospace' },
  header: { display: 'flex', justifyContent: 'space-between', borderBottom: '1px solid #112240', paddingBottom: '20px', marginBottom: '30px' },
  addClassBtn: { color: '#00ff41', border: '1px solid #00ff41', padding: '8px 15px', textDecoration: 'none' },
  gridContainer: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))', gap: '30px' },
  section: { background: '#112240', padding: '20px', borderRadius: '10px' },
  form: { display: 'flex', flexDirection: 'column', gap: '15px' },
  input: { padding: '10px', background: '#0a192f', border: '1px solid #233554', color: '#fff' },
  updateBtn: { padding: '10px', background: '#00ff41', color: '#0a192f', border: 'none', fontWeight: 'bold', cursor: 'pointer' },
  tabHeader: { display: 'flex', gap: '15px', marginBottom: '20px', borderBottom: '1px solid #233554' },
  tab: { background: 'transparent', border: 'none', color: '#444', cursor: 'pointer', padding: '10px' },
  activeTab: { background: 'transparent', border: 'none', color: '#00ff41', cursor: 'pointer', padding: '10px', borderBottom: '2px solid #00ff41' },
  listContainer: { maxHeight: '400px', overflowY: 'auto' },
  card: { background: '#0a192f', padding: '15px', marginBottom: '10px', borderRadius: '5px', display: 'flex', justifyContent: 'space-between', alignItems: 'center', borderLeft: '3px solid #00ff41' },
  approveBtn: { background: '#00ff41', color: '#0a192f', border: 'none', padding: '5px 10px', borderRadius: '3px', fontWeight: 'bold', cursor: 'pointer' }
};

export default Admin;
